import Paper from "@mui/material/Paper";
import Divider from "@mui/material/Divider";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import MainBanner from "./components/MainBanner";
import RecentPosts from "./components/RecentPosts";
import Link from "@mui/material/Link";
import Box from "@mui/material/Box";

export default function Home() {
  return (
    <>
      {/* <MainBanner /> */}

      <Box sx={{ maxWidth: "md", margin: "auto", paddingTop: "140px" }}>
        <Typography align="center" variant="h3">
          Ensure your Mainframe Security
        </Typography>
        <Typography align="center" variant="h4">
          with zSIEM Monitoring Solution
        </Typography>

        <Button
          href=""
          target="blank"
          sx={{ m: "10px" }}
          variant="contained"
          size="large"
        >
          Buy Now{" "}
        </Button>
      </Box>
      <Box sx={{ mt: "10px", maxWidth: "sm" }}>
        <Typography>
          The only security & compliance platform developed specifically for the
          z/OS operating system.
        </Typography>
      </Box>
      <RecentPosts />
    </>
  );
}
